import React, { useState, useEffect } from "react"
import * as Icon from "react-feather";

const EventsTimeline = (props) => {
    const [last5Days, setLast5Days] = useState([])

    useEffect(() => {
        setLast5Days(props.tests.reverse().slice(0, 5))
    }, [props])

    return (
        <div>

            <div className="row">
                <div className="col-sm-12">
                    <div className="timeline-main">
                        <ul className="stepper stepper-vertical timeline timeline-simple pl-0">
                            {last5Days.map((daysData, index) => (
                                <li key={index}>
                                    <a href="#!">
                                        <span className="circle blue"></span>
                                    </a>

                                    <div className="row step-content p-4 hoverable">
                                        <div className="col-6">
                                            {/* <h4 className="font-weight-bold">Duis aute irure dolor</h4> */}
                                            <p className="text-muted mt-3"><i className="far fa-clock" aria-hidden="true"></i>{daysData.updatedon}</p>
                                            <p className="mb-1">
                                                Total tested : {Number(daysData.totaltested).toLocaleString()}
                                            </p>
                                            <p className="mb-1">
                                                <Icon.Plus size={15} />Ve : {daysData.positive}, <Icon.Minus size={15} />Ve : {daysData.negative}
                                            </p>
                                            <p className="mb-1">
                                                Positivity rate : {daysData.testpositivityrate}
                                            </p>
                                            <p className="mb-1">
                                                Tests/million : {daysData.testspermillion}
                                            </p>
                                        </div>
                                        <div className="col-6">
                                            asafasf
                                        </div>
                                    </div>
                                </li>
                            ))}
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default EventsTimeline
